    "2015-09-27T00:26:21.633481",nt"name": "1997-sacramento-inland-floodplain-lidar",nt"isopen":
    false,nt"url": null,nt"notes": "This data set includes data collected in
    October 1997 over the Sacramento, CA, floodplain. Laser mapping uses a pulsed laser
    ranging system mounted onboard an aircraft to measure ground elevation and topography.
    The laser emits laser beams at high frequency and is directed downward at the earth's
    surface through a port opening in the bottom of the aircraft's fuselage. The laser
    system records the time difference between emission of the laser beam and the reception
    of the reflected laser signal in the aircraft. The aircraft travels over the beach
    at approximately 60 meters per second while surveying from the low water line to
    the landward base of the sand dunes.",nt"license_title": null,nt"extras":
